import React,{useState,useEffect} from 'react';

function Test() {
  const vocab = () => {
     const allVocab = fetch('http://localhost/PWA-tutorial-training/learn-chinese/backend/index.php?lesson=flash')

     return (
        <div className="vocab">
          {allVocab.map((word) => (
            <div className="word">{word}</div>
          ))}
        </div>)
  }
  return (
    <div className="App">
        chuck testa
        {vocab}
    </div>
  );
}

export default Test;
